import {Chart} from 'chart.js';

export const data = {
    labels: ["Tired", "Not Tired"],
    datasets: [
      {
        label: "# of Votes",
        data: [12, 19],
        backgroundColor: ["rgba(255, 99, 132, 0.2)", "rgba(54, 162, 235, 0.2)"],
        borderColor: ["rgba(255, 99, 132, 1)", "rgba(54, 162, 235, 1)"],
        borderWidth: 1
      }
    ]
  };

const PieGraph = () => {
    var xPieValues=["Tired","Not Tired"];
    var barColors = ["#b91d47","e8c3b9"];
    console.log("YOOOOO");
    new Chart("PieChartDay", {
        type: "pie",
        data: {
            labels: xPieValues,
            datasets: [{
            backgroundColor: barColors,
            data: [55, 49]
            }]
        },
        options: {
            title: {
            display: true,
            }
        }
        });

    return (<canvas id="PieChartDay" style="width:100%;"></canvas>);
}

export default PieGraph;
